import { useState, useEffect } from "react";

const ToggleElement = () => {
  const [toggleValue, setToggleValue] = useState(false);

  const handleChange = () => {
    setToggleValue(!toggleValue);

    console.log(toggleValue);
  };

  return { handleChange, toggleValue };
};
export default ToggleElement;
